import requests
import json

url = "http://25.18.122.72:10000/OCR04"
headers = {
        "Content-Type": "application/json"
    }

def predict(img_Name,img_base64):

    data = {
        "fileName": img_Name,
        "base64": img_base64 }


    response = requests.post(url=url, json=data, headers=headers)


    print(response.status_code)
    content = json.loads(response.json())
    print(content)
    return content

if __name__ == '__main__':
    img_Name = "ä¸­.png"
